    return(
        <div>
          <h1>NextJS with Dynamic SEO Page</h1>
        </div>
    )
} 

Index.getInitialProps = ()=>{
    return getHeadData().then(data=>{
        if(data.error){
            console.log(data.error)
        }else{
            return{
                headerData: data.seoData[0]
            }
        }
    })
}

export default Index
